/**
 * Secret Sauce: Fuzzy Match & Domain Resolution
 * English comments only per user preferences.
 */

const allData = $input.all();

// 1. Separate HubSpot Reference Data from incoming leads
const hubspotCompanies = allData.filter(i => 
  i.json.hs_object_id || 
  i.json.properties?.hs_object_id || 
  i.json.is_reference_data
);

const leads = allData.filter(i => 
  i.json.company && 
  !i.json.hs_object_id && 
  !i.json.properties?.hs_object_id
);

return leads.map(lead => {
    let bestMatch = null;
    let highestScore = 0;

    // --- AGNOSTIC DOMAIN RESOLUTION (Plan B) ---
    // Extract raw string from Gemini (handles Simplified Output or nested structure)
    let rawGemini = lead.json.text || lead.json.content?.parts?.[0]?.text;
    let cleanedGemini = null;

    if (rawGemini) {
        // English comment: Strictly remove brackets [], quotes "", newlines \n and spaces
        cleanedGemini = rawGemini.replace(/["'\[\]\n\r\t]/g, "").trim().toLowerCase();

        // Ensure 'null' strings from AI are treated as actual nulls
        if (cleanedGemini === "null" || cleanedGemini === "") {
            cleanedGemini = null;
        }
    }

    // Priority chain for Domain resolution
    const leadDomain = (
        cleanedGemini ||
        lead.json.company_domain || 
        lead.json.email?.split('@')[1] || 
        lead.json.domain
    )?.toLowerCase().trim();

    const leadCompany = lead.json.company;

    // --- MATCHING ENGINE ---
    for (const hs of hubspotCompanies) {
        let currentScore = 0;
        const hsProps = hs.json.properties || {};

        // Extract HubSpot identifiers
        const hsDomain = (hs.json.domain || hsProps.domain)?.toLowerCase().trim();
        const hsName = (hsProps.name || hs.json.name || hs.json.company);

        // A. Hard Match on Domain (Highest Confidence)
        if (leadDomain && hsDomain && leadDomain === hsDomain) {
            currentScore = 1.0;
        } 
        // B. Fuzzy/Substring Match on Name
        else if (leadCompany && hsName) {
            const s1 = String(leadCompany).toLowerCase().trim();
            const s2 = String(hsName).toLowerCase().trim();

            if (s1 === s2) {
                currentScore = 1.0;
            } else if (s1.includes(s2) || s2.includes(s1)) {
                currentScore = 0.95;
            }
        }

        if (currentScore > highestScore) {
            highestScore = currentScore;
            bestMatch = hs;
        }
    }

    // Return finalized agnostic object
    return {
        json: {
            updates_payload: {
                ...lead.json,
                domain: leadDomain || null
            },
            similarity_score: Math.round(highestScore * 100),
            existing_company_id: bestMatch ? (bestMatch.json.id || bestMatch.json.hs_object_id || bestMatch.json.properties?.hs_object_id) : null
        }
    };
});

